import {useState} from 'react';

export default function AuthJWT() {
    const [jwt, setJWT] = useState(localStorage.getItem('jwt'));

    if (jwt) {
        console.log("JWT exists");
    }

    if (!jwt) {
        console.log("JWT does not exist");
    }

    return true;

}
